 export const DetailsWrapper = styled.div`
  padding-top: 90px; 
  margin: 0 auto;
  width: 50%;
  display: flex;
  flex-direction: column;
  text-align: center;
 `

 export const InfoSection = styled.div`
  display: flex;
  flex-direction: column;
 `
 export const Title = styled.div`
  font-size: 30px;

 `
 export const Info = styled.div`
  display: flex;
   p {
    margin: 20px;
   }
  `

  export const Icon = styled.img`
   height: 10px;
  `
